import React from "react";
import { Carousel } from 'react-responsive-carousel';
import 'react-responsive-carousel/lib/styles/carousel.min.css';
import './home.css';
const Home = () => {
    return (
        <>
            <section className="home home-page">
                <div className="home-container">
                    <div className="row">
                        {/* <h1>Home Decor</h1>
                        <h1>Made Easy</h1> */}
                        <div className="quotes-container">
                            <Carousel showThumbs={false}
                                showArrows={true}
                                autoPlay={true}
                                interval={1000}
                                transitionTime={300}>
                                <div>
                                    <h1 className="quote">Quote 1</h1>
                                </div>
                                <div>
                                    <h1 className="quote">Quote 2</h1>
                                </div>
                                <div>
                                    <h1 className="quote">Quote 3</h1>
                                </div>
                                {/* Add more quote slides as needed */}
                            </Carousel>
                        </div>
                    </div>
                </div>
            </section>
        </>
    );
}

export default Home;
